// import four from "../dataAll/MemberData4.json";
import four from "../dataAll/MemberData4.json";
import Snowfall from "react-snowfall";

const MemberFourth = () => {
  const fourth = four.map((infor) => (
    <div className="embla__slide">
    
      <MemberCard infor={infor} />
   
    </div>
  ));
  // const third = three.map((infor) => (
